export default function Sobre() {
  return (
    <div>
      <h1>Este projeto foi criado por Bruno Machado e Plinio Gonçalves</h1>
      <h2>
        O objetivo do projeto era realizar um clone do Airbnb, uma empresa
        americana que opera um mercado online de hospedagem, principalmente
        casas de família para aluguel por temporada e atividades de turismo.{" "}
      </h2>
      <h3>
        Sendo assim, foi utilizado os conhecimentos nas tecnologias ensinadas no
        estágio da DBServer, como React, MongoDB, Express, Node.js,
      </h3>
    </div>
  );
}
